  [],\n\t\"revision_timestamp\": \"2016-07-27T23:04:49.570377\",\n\t\"name\": \"species-status-assessment-for-the-sonoran-desert-tortoise\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Sonoran desert tortoise (Gopherus morafkai)
  occurs in various habitat types in Arizona and northern Mexico. It was made a candidate
  for listing in 2010 by the U.S. Fish and Wildlife Service (Service) under the Endangered
  Species Act of 1973, as amended (Act) (75 FR 78094, December 14, 2010). The species
  is now being reviewed for listing as a threatened or endangered species under the
  Act. This Sonoran Desert Tortoise Species Status Assessment Report (SSA Report,
  SSA) is a summary of the information assembled and reviewed by the Service and incorporates
  the best scientific and commercial data available. This SSA Report documents the
  results of the comprehensive status review for the Sonoran desert tortoise to inform
  the listing decision under the Act and to inform future conservation efforts.\",\n\t\"license_title\":
